## Description

Update liquid utils to minimize basic duplicated efforts across integrations, this PR is apart of a chain so others will depend on these functions for further development.

Quip [Doc](https://axon.quip.com/JB9NAgvlaFlb/Liquid-Upgrade-Ts-Base-functions)

getNestedValue -> building block for other functions and filter in liquid to help cutdown unnecessary variable creation.

matchListObjsByKey -> this is used to connect different part of a payload together given a shared unique key

addGuidToObjArray -> aims to replace the need for following template in liquid and limit the need for checking if items are at specific index to build relationship links 
```
{%- capture personIds -%}
{%- for person in personList -%}
	{{"" | guid }}
	{%- unless forloop.last == true  -%},{%- endunless -%}
{%- endfor -%}
{%- endcapture -%}
{%- assign personIdsArray = personIds | split "," -%}

{%- capture personLocationIds -%}
{%- for person in personList -%}
	{{"" | guid }}
{%- unless forloop.last == true  -%},{%- endunless -%}
{%- endfor -%}
{%- endcapture -%}
{%- assign personLocationIdsArray = personLocationIds | split "," -%}
```
the above code would turn into:
``` personIdsArray = personList | addGuidToObjArray 'axonId', 'axonLocationId' ```

objGenerator -> Transform object[] into a new object[]
objAggregator -> collects object and converts non dup values to a list at the same key
guidWrapObj -> takes an object[] and gives it a guid key and splits a list into separate object with new guids
jsonEncode -> add indent option

